import Layout from '../../components/Layout';
import Link from 'next/link';

// Blog Sample
const PostLink = ({ id, title, content, image }) => {
    return (
        <li>
            <Link as={`/b/${id}`} href={`/blog/detail?title=${title}&content=${content}&image=${image}`}>
                <a>{title}</a>
            </Link>
        </li>
    );
}
const Index = () => {
    return (
        <Layout> 
            <h3>Blog Sample</h3>
            <ul>
                <PostLink
                    id="1"
                    title="初めてのNextアプリです"
                    content="NextでBlogチュートリアルに挑戦NextでBlogチュートリアルに挑戦NextでBlogチュートリアルに挑戦NextでBlogチュートリアルに挑戦NextでBlogチュートリアルに挑戦"
                    image="...path..."
                /> 
            </ul>
        </Layout>
    );
}

export default Index;
